    "2013-03-19T00:30:52.273363",nt"name": "major-oxide-minor-oxide-and-trace-element-geochemical-data-from-rocks-and-stream-sediments-2007",nt"isopen":
    false,nt"url": null,nt"notes": "Mineral-resources personnel from the Alaska
    Division of Geological & Geophysical Surveys carried out a geological field survey,
    including mapping and sampling northeast of Fairbanks in the Circle A-4, A-5, B-4,
    and B-5 quadrangles, Alaska from May 31 to June 28, 2007. The fieldwork provides
    basic information critical to building an understanding of Alaska geology and is
    part of an integrated program of airborne geophysical surveys followed by geological
    mapping. During 2007, 128 rock samples were collected for geochemical trace-element
    analysis, and 44 rock samples were collected for whole rock (major- and minor-oxide)
    analysis. Petrogenetically important trace-elements will be analyzed in a subsequent
    study to be published with the final map and report for this area. In addition,
    67 stream sediment samples were collected for geochemical trace-element analysis.
    The stream sediment geochemical study was conducted over the proposed Mount Ryan
    Remote Recreational Cabin Staking Area as considered by Alaska's Division of Mining,
    Land & Water in 2007.",nt"license_title": null,nt"extras": [{ntt"key":
